import React from 'react';

interface Props{
    name:string,
    imgsrc?:string,
    rating:number,
    synopsis?:string

}

export const Movie:React.FC<Props>=({name,imgsrc,rating,synopsis}) =>{
    return (
        <div className="movie">
            <img src="https://en.wikipedia.org/wiki/Luca_(2021_film)#/media/File:Luca_(2021_film).png" alt="Movie Image" />
            <div className="lower-content">
                <h1>{name}</h1>
                <p>{synopsis}</p>
                <h3>Rating: {rating}</h3>
            </div>
        </div>
    );
}

export default Movie;
